hnology being implemented in the apartments.</p>\r\n<p>Development Address: Blu Bracknell Wokingham Rd, Bracknell RG42 1AD</p>',	'closed',	'tRvqwjDAs0GH6aCgBayqlAa6Bpn85i.jpg',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Admin',	'1450',	'372',	'270',	'2.5',	'10',	'70',	'Interest Only',	'1250',	'10',	NULL,	NULL,	NULL,	'1',	NULL,	NULL,	'Fe4Q4mznZKW6rgD7TOeh',	'Fe4Q4mznZKW6rgD7TOeh',	'2022-11-28 05:42:48',	'2022-12-14 08:59:48'),
(47,	NULL,	NULL,	'60ireZElPqO8TZC1YCfuHWno5wxXLT',	'Urban Green',	'Q4 2023',	'Apartments',	'Yes',	NULL,	'Manchester',	'1 and 2 beds',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'169000',	'Simultaneous Exchange and Completion',	NULL,	NULL,	'<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2375.467248490529!2d-2.2763657841572678!3d53.460109080003036!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x487bae066dea96d3%3A0x7f0af723ed2d9aef!2sTrafford%20Plaza%2C%2073%20Seymour%20Grove%2C%20Old%20Trafford%2C%20Stretford%2C%20Manchester%20M16%200UB%2C%20UK!5e0!3m2!1sen!2ske!4v1669969062157!5m2!1sen!2ske\" width=\"100%\" height=\"400\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>',	'5000',	'Yes',	NULL,	'<p>Urban Green is a stunning new luxury development in one of Manchester&rsquo;s most exciting up-and-coming areas.<br />Comprised of 174 one- and two-bedroom apartments, this building offers a high-end lifestyle and all the convenience of city-centre living at a more affordable price.</p>\r\n<p>This secure community has been designed by award winning architects and is ideal for first-time buyers and families looking to live in a convenient location with outstanding transport links, educational institutions and proximity to some of Manchester&rsquo;s finest green spaces and sports venues.</p>\r\n<p>Development Address: 73 Seymour Grove, Old Trafford, Stretford, Manchester, M16 0UB</p>',	'closed',	'akRoVhoS.jpg',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Admin',	'1450',	'372',	'270',	'1.81',	'25',	'75',	'Interest Only',	'1250',	'10',	NULL,	NULL,	NULL,	'21',	NULL,	'HEATHSIDE IS THE FINAL PHASE TO BE RELEASED IN THIS LANDMARK REGENERATION DEVELOPMENT IN THE HEART OF SOUTH EAST LONDON.\r\nSPACIOUS HOMES THAT ARE BUILT WITH A FOCUS ON THE QUALITY OF CRAFTSMANSHIP AND A DESIGN WHICH CLEVERLY CONNECTS THEM WITH THE OUTDOORS AND THE WIDER LANDSCAPE.',	'Fe4Q4mznZKW6rgD7TOeh',	'Fe4Q4mzn