(48,	NULL,	NULL,	'072TqbRo506V83dACN2yOElBN0orcF',	'Pavilion Wharf',	'Q3 2024',	'Apartments',	'Yes',	NULL,	'Manchester',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'179950',	'Simultaneous Exchange and Completion',	NULL,	NULL,	'<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2374.6439442960823!2d-2.2673235841567085!3d53.47482318000617!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x487bae1fcbf0969f%3A0xf72b52fbd35bb2e8!2sDerwent%20St%2C%20Salford%2C%20UK!5e0!3m2!1sen!2ske!4v1669969537447!5m2!1sen!2ske\" width=\"100%\" height=\"400\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>',	'5000',	'Yes',	NULL,	'<p>Pavilion Wharf comprises one, two and three-bedroom contemporary apartments all designed to the highest standard to provide residents with luxury waterside living.</p>\r\n<p>Pavilion offers a comprehensive suite of on-site amenities to allow residents to enjoy a twenty-first-century city lifestyle to the full.<br />A gymnasium, residents&rsquo; lounge, coworking space, concierge services, a dedicated post room and secure car parking as well as cycle storage, provides the reward for living in one of the UK&rsquo;s most dynamic cities.<br />To indulge in quieter moments, residents benefit from an additional garden terrace on which to relax overlooking the river and to enjoy their own private outside space away from the bustle of modern city life.<br />An excellent range of local shops, bars and restaurants can be found within walking distance or easy bike ride.</p>\r\n<p>&bull; High-specification 17 storey building with 1, 2 &amp; 3-bed apartments<br />&bull; 160 stunning waterside apartments with impressive city and water views.<br />&bull; Surrounded by high-quality public realm, including a new landscaped area with a tree lined boulevard, public square and seating steps overlooking the River Irwell.<br />&bull; A gymnasium, residents&rsquo; lounge, coworking space, concierge services</p>\r\n<p>Address: Derwent Street, M5 4RE</p>',	'Available',	'ajditSEX.png',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Admin',	'1450',	'372',	'270',	'2',	'20',	'75',	'Interest Only',	'1250',	'10',	NULL,	NULL,	NULL,	NULL,	NULL,	'PAVILION WHARF COMPRISES ONE, TWO AND THREE- BEDROOM CONTEMPORARY APARTMENTS ALL DESIGNED TO THE HIGHEST STANDARD TO PROVIDE RESIDENTS WITH LUXURY WATERSIDE LIVING.',	'Fe4Q4mznZKW6rgD7TOeh',	'Fe4Q4mznZKW6rgD7TOeh',	'2022-12-02 08:24:38',	'2023-03-08 09:56:16'),
(49,	NULL,	NULL,	'dikv8OHfMkfGjudb5o2aoMuLs1J9wj',	'Phoenix',	'Nov 2023',	'Apartments',	'Yes',	NULL,	'Cambridge',	'1, 2 bed and 3 bed Duplexes',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'350000',	'20% on Exchange / 80% on Completion',	NULL,	NULL,	'<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2444.785979904525!2d0.14432201579598292!3d52.210936679756834!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x47d87020133d56f9%3A0xc83d933ddad38230!2sNewmarket%20Rd%2C%20Cambridge%20CB5%208JL%2C%20UK!5e0!3m2!1sen!2ske!4v1670228317173!5m2!1sen!2ske\" width=\"100%\" height=\"400\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>',	'5000',	'Yes',	NULL,	'<p>Situated on Newmarket Road, the primary eastern route into the City Centre, the development offers fast and easy access by bike, car or on foot to Cambridge&rsquo;s acclaimed University, thriving employment hubs and a vast range of<br />attractions and amenities.<br />The stylish part three-storey, part five-storey new<br />apartment building is set back from the road and boasts a full height glazed entrance that leads to thirteen residences; ten one-bedroom apartments, one two-bedroom apartment and two three-bedroom duplexes.</p>\r\n<p>&bull; One of the most beautiful cities in the world (Forbes, 2010)<br />&bull; Thirteen residences; ten one-bedroom apartments, one two-bedroom apartment and two two-bedroom duplexes<br />&bull; Prime Central Location<br />&bull; Phoenix is a rare opportunity to secure a high-quality<br />home in a truly desirable location.</p>\r\n<p>Address: Newmarket Road Cambridge CB5 8JL</p>',	'Available',	'WScP6Hob8pRWjEaC3sceMn6hBqy1Xj.jpg',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Admin',	'1450',	'654',	'270',	'2',	'20',	'75',	'Interest Only',	'1250',	'10',	NULL,	NULL,	NULL,	'0',	NULL,	NULL,	'Fe4Q4mznZKW6rgD7TOeh',	'Fe4Q4mznZKW6rgD7TOeh',	'2022-12-05 08:19:41',	'2023-03-08 09:56:16'),
(50,	NULL,	NULL,	'tSIqE3CHf73WQchBcroyeKBXTEYTYR',	'APEX Lofts',	'March 2023',	'Apartments',	'Yes',	NULL,	'Digbeth Birmingham',	'25 x 1 bed; 31 x 2 beds; 14 Duplex',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'219330',	'25% on Exchange, balance (75%) on completion',	NULL,	NULL,	'<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2430.3771395071135!2d-1.8837333841942954!3d52.47230687980526!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x4870bc7f97eb7ebb%3A0x7eaa97c61ae18852!2s50%20Warwick%20St%2C%20Deritend%2C%20Birmingham%20B12%200NH%2C%20UK!5e0!3m2!1sen!2ske!4v1670229839399!5m2!1sen!2ske\" width=\"100%\" height=\"400\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>',	'5000',	'Yes',	NULL,	'<p>A brand new design-focussed development of 80 stunning high quality apartments located in the centre of Birmingham.</p>\r\n<p>Apex Lofts has been designed with a core focus on occupier demand, through architectural innovation, pioneering integration and exceptional specification. The building, which offers a selection of well-designed one bedroom, two bedroom and duplex apartments is arranged over nine levels, providing stunning views over Birmingham&rsquo;s iconic skyline. Cutting edge features have been incorporated into the design of Apex Lofts, such as the contemporary &rsquo;Saw Tooth&rsquo; roof, reflectant of the industrial heritage of the area. Facilities offered in the development include cycle store, residents gym and rooftop garden.</p>\r\n<p><br />Development Address: 50 Warwick Street, Birmingham, B12 0NH</p>',	'Available',	'9VpwxOnr.jpg',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Admin',	'1450',	'372',	'270',	'1.57',	'20',	'75',	'Interest Only',	'1250',	'10',	NULL,	NULL,	NULL,	'0',	NULL,	NULL,	'Fe4Q4mznZKW6rgD7TOeh',	'Fe4Q4mznZKW6rgD7TOeh',	'2022-12-05 08:49:01',	'2023-03-08 09:56:16'),
(51,	NULL,	NULL,	'dJUlfwGdgiUbTbn2GtmsimrA7dtHg8',	'Broadoaks Phase 3',	'June 2022',	'Apartments',	'Yes',	NULL,	'Solihull',	'Studios, 1, 2 and 3 beds',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'195000',	'20% / 80%',	NULL,	NULL,	'<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2433.427396385319!2d-1.7941645841963534!3d52.41705317979489!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x4870b9fec4fbf4ef%3A0x28d135857a42abfb!2sRoomotel%20-%20Broadoaks%20Apartments!5e0!3m2!1sen!2ske!4v1670230446603!5m2!1sen!2ske\" width=\"100%\" height=\"400\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>',	'5000',	'Yes',	NULL,	'<p>Broadoaks is a new residential community in the hear of affluent Solihull (B91). Its combination of refined living and casual elegance connects past, present and future.</p>\r\n<p>A unique find in today&rsquo;s property market, Broadoaks provides contemporary modern living in the heart of one of the UK&rsquo;s most desirable places to live - offering you the choice of a town or country lifestyle.<br />Broadoaks Phase 3 is an intimate collection of 96 contemporary styled residences situated within a secluded setting in the sophisticated haven of Solihull. Set apart but within easy reach of the town centre, these private apartments are crafted for the individual, making them perfect for a new generation of aspiring homeowners.</p>\r\n<p>Development Address: Broadoaks, Streetsbrook Road, Solihull B91 1QY</p>',	'Available',	'EHjJDPrY.png',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Admin',	'1450',	'444',	'270',	'2',	'20',	'75',	'Interest Only',	NULL,	'10',	NULL,	NULL,	NULL,	'0',	NULL,	NULL,	'Fe4Q4mznZKW6rgD7TOeh',	'Fe4Q4mznZKW6rgD7TOeh',	'2022-12-05 08:54:56',	'2023-03-08 09:56:16'),
(52,	NULL,	NULL,	'rukBNYwsyLxOQyC3AAm85vpmSiKyEr',	'The Axium',	'Q2 2020',	'Apartments',	'Yes',	NULL,	'Birmingham',	'1, 2 beds',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'361950',	'simultaneous Exchange and Completion',	NULL,	NULL,	'<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2430.292130735171!2d-1.9036211841942614!3d52.47384617980547!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x4870bc61d78a66f1%3A0xf1f39ea770e7448e!2sWindmill%20St%2C%20Birmingham%2C%20UK!5e0!3m2!1sen!2ske!4v1670231780896!5m2!1sen!2ske\" width=\"100%\" height=\"400\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>',	'5000',	'Yes',	NULL,	'<p>The Axium is a contemporary new development on a 2.3-acre site located in the very heart of Birmingham. Located just south of Holloway Head, The Axium is just a few minutes walk from Grand Central-New Street Station, the top-end shopping centers and the business and financial district.</p>\r\n<p>The development comprises 304 high-end residential apartments designed with practical and well-thought out layouts fitted with top-end finishing and specifications, modern Porcelanosa kitchen designs, fully fitted with high-end Bosch electrical appliances and luxury, fully tiled, bathrooms and en-suite.</p>\r\n<p>Development Address: Windmill Street, Birmingham B1 1NS, UK</p>\r\n<p>NOTE: Please contact your API Account Manager to confirm availability list.</p>',	'Available',	'Rzwt4y2w.jpg',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Admin',	'1450',	'408',	'1450',	'3',	'15',	'75',	'Interest Only',	'1250',	'10',	NULL,	NULL,	NULL,	'350',	NULL,	NULL,	'Fe4Q4mznZKW6rgD7TOeh',	'Fe4Q4mznZKW6rgD7TOeh',	'2022-12-05 09:17:16',	'2023-03-08 09:56:16'),
(53,	NULL,	NULL,	'tEbPdzursEF6Ovd6nX9yWbPuo30OHp',	'Heaton House, Jewellery Qtr',	'December 2022',	'Apartments',	'Yes',	NULL,	'Birmingham',	'1, 2 bed and 3 bed Townhouses',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'205920',	'20% on Exchange / 80% on Completion',	NULL,	NULL,	'<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2429.6378419269713!2d-1.9207530841937934!3d52.48569267980769!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x4870bceff2ff8423%3A0xf965daf7d7224f0!2sCamden%20St%2C%20Birmingham%20B1%2C%20UK!5e0!3m2!1sen!2ske!4v1670232578277!5m2!1sen!2ske\" width=\"100%\" height=\"400\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>',	'5000',	'Yes',	NULL,	'<p>Inspired by history, Heaton House will be home to a private house, 14 contemporary townhouses &amp; 42 industrial style apartments, ensuring that rich history once more delivers a new vision for life at the heart of the city.</p>\r\n<p>A rarity like Heaton House comes along once in a lifetime. Its roots are written deep into the city&rsquo;s folklore. Its origins, as a 19th century georgian villa in Camden Street, form part of the rich suburban middle-class enclaves that grew with the expansion of the Jewellery Qtr.</p>\r\n<p>&bull; A development of 42 apartments and 14 townhouses plus the restoration of a 4-bed Georgian Villa<br />&bull; What sets Heaton House apart is its historical recreation.<br />&bull; Fully modernised generous open plan accommodation with well curated specifications &amp; state of the art features.</p>\r\n<p>Address: Camden Street, Birmingham, B1 3BZ</p>',	'Available',	'cjyME0f2.jpg',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Admin',	'1450',	'372',	'270',	'1.9',	'20',	'75',	'Interest Only',	'1250',	'10',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Fe4Q4mznZKW6rgD7TOeh',	'Fe4Q4mznZKW6rgD7TOeh',	'2022-12-05 09:30:06',	'2023-03-08 09:56:16'),
(54,	NULL,	NULL,	'GjulblwW1cJ2KED4eqA4L3ind3qExq',	'Trent Bridge Quays',	'B5 Q1 2022, B6 10/2021, B7 10/2021',	'Apartments',	'Yes',	NULL,	'Nottingham',	'1, 2 and 3 beds, and Townhouses',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'219300',	'20% on Exchange and 80% on Completion',	NULL,	NULL,	'<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2404.2100788879375!2d-1.1348555841766477!3d52.944642879896826!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x4879c3dad8dae893%3A0x2ef1ae514a994294!2sMeadow%20Ln%2C%20Nottingham%2C%20UK!5e0!3m2!1sen!2ske!4v1670233979337!5m2!1sen!2ske\" width=\"100%\" height=\"400\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>',	'5000',	'Yes',	NULL,	'<p>A Waterside Vision Made Real</p>\r\n<p>Built on the banks of the River Trent and within easy reach of West Bridgford and Nottingham City Centre, Trent Bridge Quays is a contemporary development f 95 desirable homes and apartments.</p>\r\n<p>No longer the choice of the privileged few, waterfront living means space, freedom and privacy. It&rsquo;s all about mind, body and soul - the perfect antidote to a busy city life.<br />A unique location that&rsquo;s at the vanguard of a new wave of investment and regeneration that will build on and expand the great success story of Nottingham. It brings together everything that&rsquo;s best. Inside and out, local and regional, classic and contemporary.<br />Interconnecting green spaces, a rich textured neighbourhood of shops, caf&eacute;s, bars and restaurants all within easy reach. It&rsquo;s a neighbourhood forging the way for a new chapter in Nottingham&rsquo;s history.</p>\r\n<p>Development Address: MeadowLane, Nottingham, NG2 3HR</p>',	'Available',	'NQPW5wPe6vK3GtdQ0QEZ3dmQs9KFAP.jpg',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Admin',	'1450',	'372',	'270',	'1.5',	'20',	'75',	'Interest Only',	'2496',	'10',	NULL,	NULL,	NULL,	'0',	NULL,	NULL,	'Fe4Q4mznZKW6r