(55,	NULL,	NULL,	'ziD4muUxDI4gCCy3Hiku5LYU6auwaG',	'Furness House',	'Completed',	'Apartments',	'Yes',	NULL,	'Redhill, Surrey',	'Studio, 1 and 2 bed',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'201000',	'Simultaneous Exchange and Completion',	NULL,	NULL,	'<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2498.124384392043!2d-0.17310868424002382!3d51.23520407959129!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x4875fb3bb1a5f291%3A0xbe03ee94f7943cba!2sFurness%20House%2C%2053%20Brighton%20Rd%2C%20Redhill%2C%20UK!5e0!3m2!1sen!2ske!4v1670234543207!5m2!1sen!2ske\" width=\"100%\" height=\"400\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>',	'5000',	'Yes',	NULL,	'<p>Situated in central Redhill, Furness House is a bespoke collection of 52 studios, one and two-bed apartments set over four floors.</p>\r\n<p>Let the countryside breeze fill your new home, whilst being connected to the energy of the city.</p>\r\n<p>&bull; Located in the centre of Redhill, Surrey<br />&bull; Situated between London and Brighton<br />&bull; Mix of studios, one &amp; two-bedroom apartments<br />&bull; Easy access to the city, the countryside and the South Coast<br />&bull; Designed with contemporary, modern living in mind, these beautifully presented apartments incorporate high-quality finishes with open plan layouts giving them a light and airy feel throughout.</p>\r\n<p><br />Address: 53 Brighton Road Redhill, Surrey, RH1 6SH</p>',	'Available',	'L1QNlsHw.jpg',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Admin',	'1450',	'372',	'270',	'1.4',	'20',	'70',	'Interest Only',	'895',	'8',	NULL,	NULL,	NULL,	'0',	NULL,	NULL,	'Fe4Q4mznZKW6rgD7TOeh',	'Fe4Q4mznZKW6rgD7TOeh',	'2022-12-05 10:02:55',	'2023-03-08 09:56:16'),
(56,	NULL,	NULL,	'BSlNIwsYPBjzmY8axPpvoXSNEDvi09',	'Priory House',	'End of July 2022',	'Apartments',	'Yes',	NULL,	'Birmingham',	'1 and 2 beds',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'211200',	'Simultaneous Exchange and Completion',	NULL,	NULL,	'<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2430.406055233439!2d-1.8993083841943281!3d52.4717832798052!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x4870bc6249930051%3A0x3d8b58c7b48abb7e!2sGooch%20St%20N%2C%20Birmingham%2C%20UK!5e0!3m2!1sen!2ske!4v1670234973391!5m2!1sen!2ske\" width=\"100%\" height=\"400\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>',	'5000',	'Yes',	NULL,	'<p>Priory house is a flagship project in the heart of Birmingham city centre.<br />The scheme will create an enduring 21st century lifestyle for its inhabitants and provide a renewed sense of purpose to this part of the city.</p>\r\n<p>Built in the 1950&rsquo;s Priory House harks back to Birmingham&rsquo;s industrial past. The proposed scheme will preserve and enhance the original building, and provide a connected space for contemporary living.</p>\r\n<p>Home of the Birmingham Forensic Science Service for more than 40 years Priory House is a 77,000 sq ft landmark mid-century building located on Gooch Street North within the cultural hub of Birmingham&rsquo;s Southside district.</p>\r\n<p>It will be brought back to life by a bold regeneration scheme that will reflect the relationship between the aesthetics of its industrial past and modern warehouse loft living.</p>\r\n<p>Address: Gooch St North, Birmingham, B5</p>',	'Available',	'OJAjhn7KcQD8KAN6IGeCwLGzbZlxJ1.jpg',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Admin',	'1450',	'444',	'270',	'2',	'20',	'75',	'Interest Only',	'1250',	'10',	NULL,	NULL,	NULL,	'0',	NULL,	NULL,	'Fe4Q4mznZKW6rgD7TOeh',	'Fe4Q4mznZKW6rgD7TOeh',	'2022-12-05 10:10:00',	'2023-03-08 09:56:16'),
(57,	NULL,	NULL,	'JbhBUSLMatrqAdQnNOTlfCMhNn2cyI',	'Timber Yard',	'Completed Development',	'Apartments',	'Yes',	NULL,	'Birmingham',	'2 beds',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'313100',	'Simultaneous Exchange and Completion',	NULL,	NULL,	'<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2430.277954152021!2d-1.896797484194234!3d52.47410287980546!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x4870bc8820336211%3A0xa0e9d3e0335bb50a!2sPershore%20St%2C%20Birmingham%2C%20UK!5e0!3m2!1sen!2ske!4v1670235265482!5m2!1sen!2ske\" width=\"100%\" height=\"400\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>',	'5000',	'Yes',	NULL,	'<p>Timber Yard is the Galliard Apsley Partnership&rsquo;s first apartment release with planning consent for 379 studios and 1, 2 &amp; 3 bedroom apartment arranged around landscaped courtyard<br />gardens.</p>\r\n<p>The development has been designed to provide exclusive lifestyle facilities including a gym, club lounge and screening room while offering high quality, highly specified living space rising 12 levels - with many apartments enjoying superb city centre views.</p>\r\n<p>Timber Yard will also be within 10 minutes walk of New Street and Moor Street stations - with Moor Street providing direct access to the forthcoming Curzon Street HS2 interchange (2029).</p>\r\n<p>Development Address: Pershore Street, Birmingham B5 6PA</p>',	'Available',	'Apcz2WZL.jpg',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Admin',	'1450',	'408',	'270',	'2.74',	'10',	'75',	'Interest Only',	'1250',	'10',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Fe4Q4mznZKW6rgD7TOeh',	'Fe4Q4mznZKW6rgD7TOeh',	'2022-12-05 10:15:00',	'2023-03-08 09:56:16'),
(58,	NULL,	NULL,	'DFvaa7LBqXD7Ak2Z9w82GWoSf9nfen',	'Heathside',	'Q4 2023',	'Apartments',	'Yes',	NULL,	'London, SE10',	'Studios, 1 and 2 beds',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'425000',	'10% / 10% 6 months later/ 80% or 20% / 80%',	NULL,	NULL,	'<iframe src=\"https://www.google.com/maps/embed?pb=!1m16!1m12!1m3!1d9919.972387765949!2d-0.20696420810674193!3d51.56836006894438!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!2m1!1sheathside%20near%20London%20SE10%2C%20UK!5e0!3m2!1sen!2ske!4v1670240804466!5m2!1sen!2ske\" width=\"100%\" height=\"400\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>',	'5000',	'Yes',	NULL,	'<p>Heathside is the final phase to be released in this landmark regeneration development in the heart of south east London.<br />Spacious homes that are built with a focus on the quality of craftsmanship and a design which cleverly connects them with the outdoors and the wider landscape.</p>\r\n<p>Conveniently positioned between the vibrant, cultural districts of Lewisham and Deptford, historic Greenwich and the naturally picturesque Blackheath - residents of Heathside have all the advantages of a well-connected Zone 2 location. The lush, open-green spaces of Greenwich Park and Blackheath Common, fantastic restaurants, lively bars and world-renowned music venues and museums are all on your doorstep to enjoy.</p>\r\n<p>Overlooking an acre of landscaped gardens, and benefiting from concierge services, a range of resident amenities and extensive underground car parking. Heathside comprises 106 new homes, including studio, one and two-bedroom apartments.</p>\r\n<p>Development Address: Heathside, London SE10</p>',	'Available',	'onwcNL4R4G43uHYgqy8x2E6ns0vpas.jpg',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Admin',	'1450',	'600',	'270',	'3',	'20',	'75',	'Interest Only',	'1250',	'10',	NULL,	NULL,	NULL,	'0',	NULL,	'HEATHSIDE IS THE FINAL PHASE TO  BE RELEASED IN THIS LANDMARK REGENERATION DEVELOPMENT IN THE HEART OF SOUTH EAST LONDON.\r\nSPACIOUS HOMES THAT ARE BUILT WITH A FOCUS ON THE QUALITY OF CRAFTSMANSHIP AND A DESIGN WHICH CLEVERLY CONNECTS THEM WITH THE OUTDOORS AND THE WIDER LANDSCAPE.',	'Fe4Q4mznZKW6rgD7TOeh',	'Fe4Q4mznZKW6rgD7TOeh',	'2022-12-05 11:44:12',	'2023-03-08 09:56:16'),
(59,	NULL,	NULL,	'fkD9J4ufbK801TVU0ho1Gr2u2hMEHT',	'Trent Bridge Quays',	'Q1 2024',	'Apartments',	'Yes',	NULL,	'Muller Yard, Nottingham',	'1, 2 bed apartments and 2, 3 bed',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'211050',	'20% on Exchange / 80% on Completion',	NULL,	NULL,	'<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2404.2100788879375!2d-1.1348555841766477!3d52.944642879896826!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x4879c3dad8dae893%3A0x2ef1ae514a994294!2sMeadow%20Ln%2C%20Nottingham%2C%20UK!5e0!3m2!1sen!2ske!4v1670241640912!5m2!1sen!2ske\" width=\"100%\" height=\"400\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>',	'5000',	'Yes',	NULL,	'<p>Trent Bridge Quays draws on the character of the local industrial and historical architecture.</p>\r\n<p>Modern townhouses and apartments are composed in a palette of classic materials and outdoor communal areas are thoughtfully landscaped to create a natural flow.</p>\r\n<p>Opening out onto a spacious promenade that runs adjacent to the river, Trent Bridge Quays makes the most of its privileged position at the water&rsquo;s edge. With its distinctive design and sensitive masterplan, this is a place that its new residents will<br />love to call home.</p>\r\n<p>The next phase of construction will create a further 58 new residencies, comprising of three and four bedroom townhouses and one, two or three bedroom apartments, some with balcony specifications. These new homes come with gated courtyard car parking, all with access to riverside communal areas.</p>\r\n<p>&bull; Prime Waterfront Location.<br />&bull; The architecture is distinctive with an urban edge.<br />&bull; The superior design is a mix of the artistic and the artisan.<br />&bull; Mix of 1 &amp; 2 bed apartments and Townhouses<br />&bull; Unapologetic craft and quality at every touchpoint.<br />&bull; Trent Bridge Quays is a lifestyle that&rsquo;s designed round you.</p>\r\n<p>Address: MeadowLane, Nottingham<br />NG2</p>',	'Available',	'hC4eSqA2.jpg',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Admin',	'1450',	'444',	'270',	'1.5',	'20',	'75',	'Interest Only',	'1250',	'10',	NULL,	NULL,	NULL,	'0',	NULL,	NULL,	'Fe4Q4mznZKW6rgD7TOeh',	'Fe4Q4mznZKW6rgD7TOeh',	'2022-12-05 12:06:07',	'2023-03-08 09:56:16'),
(60,	NULL,	NULL,	'MQs7LPbmh6rExApqIIAPMc81cJ0ZK4',	'Boulevard',	'Q4 2024',	'Apartments',	'Yes',	NULL,	'Birmingham',	'1 and 2 beds',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'199950',	'20% on Exchange / 80% Completion',	NULL,	NULL,	'<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2430.4434604948765!2d-1.9021789844248622!3d52.47110594760434!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x4870bc61736306eb%3A0x7ec4d43409fb7231!2sBristol%20St%2C%20Birmingham%2C%20UK!5e0!3m2!1sen!2ske!4v1670242583911!5m2!1sen!2ske\" width=\"100%\" height=\"400\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>',	'5000',	'Yes',	NULL,	'<p>Open the door to a new chapter of luxury living and scale the heights, all from the comfort of your own home. Welcome to Birmingham&rsquo;s premier new neighbourhood! Centrally located in the heart of Birmingham&rsquo;s Southside, Boulevard provides 145 beautifully designed apartments woven into the city&rsquo;s Cultural Quarter. A great place to enjoy a fusion of city living, dining and the arts.</p>\r\n<p>Boulevard offers a comprehensive suite of on-site amenities including a gymnasium, residents lounges, concierge services, a dedicated concierge and secure car parking as well as cycle storage provides the reward for living in one of the UK&rsquo;s most dynamic cities. Residents benefit from a large modern gardens on which to relax and to enjoy their own private outside space away from the bustle of modern city life.</p>\r\n<p>Residents can easily access Birmingham city centre by foot and are well connected by public transport with frequent bus services throughout the day.<br />An excellent range of local shops, bars and restaurants can be found within walking distance along Bristol Street, the famous Custard Factory and legendary Arcadian.</p>\r\n<p>Development Address: Bristol Street, Birmingham</p>',	'Available',	'trf6pabR.jpg',	NULL,	NULL,	NULL