(1002,	NULL,	NULL,	'bz9GIVnGDp26vTnkzAp0pvOd6ZVPhU',	'Viadux',	'Q2 2024',	'Apartments',	'Yes',	NULL,	'Manchester',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'424200',	'25% on Exchange, balance (75%) on completion',	NULL,	NULL,	'<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2374.6352650866775!2d-2.2488016841566907!3d53.47497828000619!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x487bb1e9a1565119%3A0x44ec6d1b56c06747!2sGreat%20Bridgewater%20St%2C%20Salford%20M3%2C%20UK!5e0!3m2!1sen!2ske!4v1677655869589!5m2!1sen!2ske\" width=\"100%\" height=\"400\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>',	'5000',	'Yes',	NULL,	'<p>Standing proudly above Deansgate, Castlefield Locks and strategically connected to the iconic former railway station, Manchester Central, Viadux brings a unique opportunity to those wishing to live within the heart of the city centre.</p>\r\n<p>The elegant forty-storey tower, designed by internationally renowned Simpson Haugh Architects, will feature exceptionally high quality one and two-bedroom apartments, complemented by luxury residential facilities.</p>\r\n<p>A residents&rsquo; swimming pool , workspaces, private cinema room, bar, gym, karaoke room and more will sit alongside breathtaking views across the city centre skyline.</p>\r\n<p>Development Address: Great Bridgewater St, Manchester, M3</p>',	'Available',	'XANhl41pDMfxMfF2UN0z9RguPamK9f.jpg',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Admin',	'1450',	'486',	'270',	'3.50',	'25',	'70',	'Interest Only',	'1250',	'10',	NULL,	NULL,	NULL,	'0',	NULL,	NULL,	'Fe4Q4mznZKW6rgD7TOeh',	'Fe4Q4mznZKW6rgD7TOeh',	'2023-03-01 07:31:39',	'2023-03-08 09:56:17'),
(1058,	NULL,	NULL,	'CwEe8aNID0BDgU83cv9iPvMA3KdMTy',	'Victoria House',	'Q2 2024',	'Apartments',	'Yes',	NULL,	'Manchester',	'2 bed apartments and 3 bed Duplex Penthouse',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'337259',	'25% on Exchange, balance (75%) on completion',	NULL,	NULL,	'<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2374.296219504311!2d-2.227517184156465!3d53.481036880007494!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x487bb1bcd4d32df9%3A0xc20b4e70ad944f9a!2sGreat%20Ancoats%20St%2C%20Manchester%20M4%2C%20UK!5e0!3m2!1sen!2ske!4v1677659465975!5m2!1sen!2ske\" width=\"100%\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>',	'2000',	'Yes',	NULL,	'<p>Victoria House is a vibrant new development in the heart of Manchester. Designed by the renowned Simpson Haugh Architects it will elegantly rise above the Piccadilly Central neighbourhood as a proud addition to Manchester&rsquo; s skyline.</p>\r\n<p>Victoria House will feature 177 apartments across 25 storeys. Residents of these high-quality one, two and three bedroom apartments will benefit from equally luxurious on-site amenities and lifestyle services.</p>\r\n<p>This fully-realised home space will transform modern city living and expand the possibilities of what it means to be a city-dweller.</p>\r\n<p>Development Address: Great Ancoats Street, Manchester, M4 7AB</p>',	'Available',	'CLqvSnHA.jpg',	NULL,	NULL,	NULL,	NULL,	NULL,	NULL,	'Admin',	'1450',	'408',	'1450',	'3.4',	'25',	'75',	'Interest Only',	'1250',	'10',	NULL,	NULL,	NULL,	'0',	NULL,	NULL,	'Fe4Q4mznZKW6rgD7TOeh',	'Fe4Q4mznZKW6rgD7TOeh',	'2023-03-01 08:31:31',	'2023-03-08 09:56:17'),
